  true,\n\t\"url\": null,\n\t\"notes\": \"EDFacts Teacher Quality, 2011-12 (EDFacts
  TQ:2011-12), is one of 17 'topics' identified in the EDFacts documentation (in this
  database, each 'topic' is entered as a separate study); program data is available
  since 2005 at <ed.gov/about/inits/ed/edfacts>. EDFacts TQ:2011-12 (ed.gov/about/inits/ed/edfacts)
  annually collects cross-sectional data from states about teacher quality based on
  the performance on programs and activities supported by the Elementary and Secondary
  Education Act (ESEA), as amended, determined by whether teachers are classified
  as highly qualified for their assignment according to state definition. Indicators
  include the number of elementary and secondary classes in core academic subjects
  and the designation of a school's poverty quartile. EDFacts TQ:2011-12 data were
  collected using the EDFacts Submission System (ESS), a centralized portal and their
  submission by states is mandatory and required for benefits. Not submitting the
  required reports by a state constitutes a failure to comply with law and may have
  consequences for federal funding to the state. Key statistics produced from EDFacts
  TQ:2011-12 are from 3 data groups with information on State Poverty Designation,
  Teacher Quality in Elementary Classes, and Teacher Quality in Secondary Classes.
  For the purposes of this system, data groups are referred to as 'variables', as
  a result of the structure and format of EDFacts' data.\",\n\t\"license_title\":
